import React from 'react';
import {Navbar} from '../../common';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
    faFacebook,
    faTwitter,
    faInstagram,
} from '@fortawesome/free-brands-svg-icons';

import './Header.css';
function Header (){
    return(
        <section className="header-name">
            <h1 className="header-name-title">InstaFill</h1>
            <h1 className="header-name-item">Form Magic!</h1>
            
            <a href="james.com" className="twitter social"><FontAwesomeIcon  icon={faTwitter} size='2x' /></a> 
            <a href="james.com" className="instagram social"><FontAwesomeIcon className="header-socials-item" icon={faInstagram} /></a> 
            <a href="james.com" className="facebook social"><FontAwesomeIcon className="header-socials-item" icon={faFacebook} /></a> 
        </section>
    )
}
export default Header;
